import moment from "moment";

export function saveDomainInfoFormToDatabase(
  siteRegistredFromDate,
  endOfActivityDate
) {
  console.log(siteRegistredFromDate);
  console.log(moment(siteRegistredFromDate).format("DD-MM-YYYY"));

  console.log(endOfActivityDate);
  console.log(moment(endOfActivityDate).format("DD-MM-YYYY"));
}
